        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Authorization": "Bearer sk_live_xr7u8ghs1k2as91"
        },
        body: JSON.stringify({ order_id: id })
      });

      const data = await response.json();
      return data;
    } catch (err) {
      return { status: "ERROR" };
    }
  }

  function logEvent(id, status) {
    fetch("/v1/event", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        event: "delivery_attempt",
        order: id,
        result: status
      })
    });
  }

